import React from 'react'
import {Container,Row,Col} from 'react-bootstrap';

const Footer = () => {
  return (
    <>
        <Container>
            <Row>
                <Col className="text-center">
                    Copyright &copy; Proshop
                </Col>
            </Row>
        </Container>
    </>
  )
}

export default Footer
